using System;

public class Solution {
    public int MinOperations(int[] nums1, int[] nums2) {
        int n = nums1.Length;
        // Check if the maximum values are already at the last position
        if ((nums1[n - 1] >= nums1.Max() && nums2[n - 1] >= nums2.Max())) return 0;

        // Check if swapping the last elements makes the conditions true
        if (nums1[n - 1] < nums2[n - 1] && nums1.Max() <= nums2[n - 1] && nums2.Max() <= nums1[n - 1]
            || nums2[n - 1] < nums1[n - 1] && nums2.Max() <= nums1[n - 1] && nums1.Max() <= nums2[n - 1]) {
            return 1;
        }

        // Check other elements for possible swaps
        int operations = 0;
        for (int i = 0; i < n - 1; i++) {
            if ((nums1[i] != nums1.Max() && nums2[i] == nums2.Max()) || (nums2[i] != nums2.Max() && nums1[i] == nums1.Max())) {
                // Swap only if it helps in achieving the goal
                if ((nums1[i] > nums1[n - 1] && nums2[i] < nums2[n - 1]) || (nums2[i] > nums2[n - 1] && nums1[i] < nums1[n - 1])) {
                    int temp = nums1[i];
                    nums1[i] = nums2[i];
                    nums2[i] = temp;
                    operations++;
                    // Check if the conditions are met after the swap
                    if (nums1[n - 1] >= nums1.Max() && nums2[n - 1] >= nums2.Max()) return operations;
                }
            }
        }

        // If conditions are met without swaps
        if (nums1[n - 1] >= nums1.Max() && nums2[n - 1] >= nums2.Max()) return operations;

        // Return -1 if it's impossible to meet the conditions
        return -1;
    }
}
